async function api(path, options) {
  const url = new URL("https://www.desmos.com" + path);
  return await fetch(url, {
    headers: {
      Accept: "application/json",
      Cookie: "sid=...", // you need to use your own cookie here
      "Content-Type": "application/json",
    },
    mode: "cors",
    ...(options ?? {}),
  });
}

